import styles from "./Input.module.css";

export default function Input({ src, alt, type, name, onChange, onBlur, value, placeholder, className }) {
    return (
        <div className={styles.inputContainer}>
            <img src={src} alt={alt} className={styles.inputIcon} />
            <input
                type={type}
                name={name}
                onChange={onChange}
                onBlur={onBlur}
                value={value}
                placeholder={placeholder}
                className={className}
            />
        </div>
    );
}
